import React from 'react';
import './SolutionPage.css';

function Construction() {
  return (
    <div className="solution-page">
      <h1 className="solution-title">Construction</h1>
      <div className="solution-desc">Rosie helps construction companies manage project inquiries, schedule site visits, and keep clients informed at all times.</div>
      <div className="solution-section">
        <h2>Why Construction Companies Use Rosie</h2>
        <ul>
          <li>Project inquiry management</li>
          <li>Site visit scheduling</li>
          <li>24/7 client communication</li>
        </ul>
      </div>
    </div>
  );
}

export default Construction;
